import '../CSS/Experience.scss'

// Components
import Hallway from '../Components/Hallway'

function Experience(props) {
  

  return (
    <div className='homeParentDiv'>

      <div class="expFront">
        <div>Testing</div>
      </div>

      <div class="expBack">
        <Hallway />
      </div>

    </div>
  );
}

export default Experience;
